import { Constants } from "sui-vue";

/* Formatting
 {
   // Array of values or Object of below format
   <prop>: Array | Object
 }
 // Any prop defaults to undefined or null
 {
   required: Boolean, // no undefined value defaulted(first value of array)
   values: Array,
   value: Any, // always undefined or if required is set then default of first array or default of type)
   label: String,
   description: String

   if value is:
   Boolean: "ui-checkbox",
   Boolean & values is array: "ui-radio"
   Array: "ui-dropdown"
   default & String: "ui-input"
 }
*/

// Analyse all props and save them here
export default {
  // all props have to exist here
  props: {

  }
};
